async function checkCards() {
  let check_cards = await fetch(
    `/_v/paypalstore.payment-provider/v0/payments/acdc/check-saved-tokens/` +
      client_ID_ACDC,
    {
      method: "POST",
      redirect: "follow",
    }
  )
    .then((response) => response.json())
    .catch((error) => console.log("error", error));
  /* console.log("Check if user have saved cards: ",check_cards) */
  return check_cards;
}

async function debugACDC() {
  const fetchData = async () => {
    try {
      var myHeaders = new Headers();
      myHeaders.append("Content-Type", "application/json");

      var requestOptions = {
        method: "POST",
        headers: myHeaders,
        redirect: "follow",
      };

      const response = await fetch(
        "/_v/paypalstore.payment-provider/v0/payments/acdc/saved-tokens",
        requestOptions
      );

      const jsonData = await response.json();
      return jsonData;
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  let cardTest = await fetchData();
  constructCards(cardTest);
}

function constructCards(cardsTest) {
  if (cardsTest) {
    //console.log(cardsTest);
    $("#acdc-table tr").remove();
    for (let index = 0; index < cardsTest.cards.length; index++) {
      let trashIcon = document.createRange().createContextualFragment(`
        <svg width="15" height="16" viewBox="0 0 15 16" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M2.4 4H1.6V14.4C1.6 14.8243 1.76857 15.2313 2.06863 15.5314C2.36869 15.8314 2.77565 16 3.2 16H11.2C11.6243 16 12.0313 15.8314 12.3314 15.5314C12.6314 15.2313 12.8 14.8243 12.8 14.4V4H2.4ZM5.6 13.6H4V6.4H5.6V13.6ZM10.4 13.6H8.8V6.4H10.4V13.6ZM10.8944 1.6L9.6 0H4.8L3.5056 1.6H0V3.2H14.4V1.6H10.8944Z" fill="#CCCCCC"/>
        </svg>
      `);
      let TR = document.createElement("tr");
      let TRSelect = document.createElement("tr");
      let TDSelect = document.createElement("td");
      let TDCardTypeMC = document.createElement("td");
      let TDCardTypeVS = document.createElement("td");
      let TDCardTypeAMX = document.createElement("td");
      let TDInput = document.createElement("td");
      let TDEmail = document.createElement("td");
      let TDToken = document.createElement("td");
      let TDTrash = document.createElement("td");
      let IN = document.createElement("input");
      let LA = document.createElement("label");
      let DI = document.createElement("div");

      TDTrash.style.cursor = "pointer";

      IN.type = "radio";
      IN.name = "payment";
      IN.id = "payment" + index;
      LA.htmlFor = "payment" + index;
      LA.innerText = "**** **** **** " + cardsTest.cards[index].lastDigits;
      LA.className = "paypal-email-text";
      DI.setAttribute("data-email", cardsTest.cards[index].id);
      IN.setAttribute("data-email", cardsTest.cards[index].id);
      DI.setAttribute(
        "onClick",
        'delete_card("' + cardsTest.cards[index].id + '");'
      );
      IN.setAttribute(
        "onClick",
        'select_card("' + cardsTest.cards[index].id + '");'
      );
      DI.appendChild(trashIcon);

      if (cardsTest.cards[index].brand.toLowerCase() === "visa") {
        TDCardTypeVS.innerHTML = Visa_Logo;
        TR.appendChild(TDCardTypeVS);
      } else if (cardsTest.cards[index].brand.toLowerCase() === "mastercard") {
        TDCardTypeMC.innerHTML = Mastercard_Logo;
        TR.appendChild(TDCardTypeMC);
      } else if (cardsTest.cards[index].brand.toLowerCase() === "amex") {
        TDCardTypeAMX.innerHTML = Amex_Logo;
        TR.appendChild(TDCardTypeAMX);
      }
      TDCardTypeMC.style = "width: 15%;";
      TDCardTypeVS.style = "width: 15%;";
      TDCardTypeAMX.style = "width: 15%;";
      TDTrash.append(DI);
      TDInput.appendChild(IN);
      TDEmail.appendChild(LA);
      TR.appendChild(TDInput);
      TR.appendChild(TDEmail);
      TR.appendChild(TDTrash);
      TDSelect.id = "selectACDC" + cardsTest.cards[index].id;
      TDSelect.className = "TRSelect";
      TDSelect.colSpan = 3;
      TRSelect.appendChild(TDSelect);
      document.getElementById("acdc-table").appendChild(TR);
      document.getElementById("acdc-table").appendChild(TRSelect);
    }
  }
  $("#paypal-loading-acdc-cards").hide();
}

async function delete_card(token) {
  if (token) {
    $("#paypal-loading-acdc").show();
    $("#acdc-newcard").hide();
    $("#paypal-main-acdc").hide();
    const fetchData = async () => {
      try {
        var myHeaders = new Headers();
        myHeaders.append("Content-Type", "application/json");

        var requestOptions = {
          method: "DELETE",
          headers: myHeaders,
          redirect: "follow",
        };

        const response = await fetch(
          "/_v/paypalstore.payment-provider/v0/payments/acdc/card/" + token,
          requestOptions
        );

        const jsonData = await response.json();
        return true;
      } catch (error) {
        console.error("Error fetching data:", error);
        return false;
      }
    };

    let cardTest = await fetchData();
    if (cardTest) {
      await buildFormACDC();
      $("#paypal-loading-acdc").hide();
      $("#acdc-newcard").show();
      $("#paypal-main-acdc").show();
    }
  }
}

async function new_card() {
  $("#paypal-loading-acdc").show();
  $("#paypal-main-acdc").hide();
  $("#acdc-newcard").hide();
  const fetchData = async () => {
    try {
      var myHeaders = new Headers();
      myHeaders.append("Content-Type", "application/json");

      var raw = JSON.stringify({
        email: vtexjs?.checkout?.orderForm?.clientProfileData?.email,
        type: "NEW_CARD",
      });

      var requestOptions = {
        method: "POST",
        headers: myHeaders,
        body: raw,
        redirect: "follow",
      };

      const response = await fetch(
        "/_v/paypalstore.payment-provider/v0/payments/acdc/customer-config",
        requestOptions
      );

      const jsonData = await response.json();
      /* console.log(jsonData) */
      if ((jsonData.succes = true)) {
        $(".payment-submit-wrap").show();
        setTimeout(() => {
          $("#payment-data-submit").trigger("click");
        }, 1000);
      }
      return true;
    } catch (error) {
      console.error("Error fetching data:", error);
      return false;
    }
  };

  let cardTest = await fetchData();
}

async function select_card(token, interval,pm) {
  //console.log("Hey",token,interval,pm)
  const fetchData = async () => {
    try {
      var myHeaders = new Headers();
      myHeaders.append("Content-Type", "application/json");

      if (interval) {
        let msi = parseInt(interval);
        var raw = JSON.stringify({
          email: vtexjs?.checkout?.orderForm?.clientProfileData?.email,
          type: "SAVED_CARD",
          cardToken: token,
          msi: {
            interval_duration: msi,
            term: pm || "PM1",
          },
        });
      } else {
        var raw = JSON.stringify({
          email: vtexjs?.checkout?.orderForm?.clientProfileData?.email,
          type: "SAVED_CARD",
          cardToken: token,
          msi: {
            interval_duration: 1,
            term: "PM1",
          },
        });
      }

      var requestOptions = {
        method: "POST",
        headers: myHeaders,
        body: raw,
        redirect: "follow",
      };

      const response = await fetch(
        "/_v/paypalstore.payment-provider/v0/payments/acdc/customer-config",
        requestOptions
      );

      const jsonData = await response.json();
      /* console.log(jsonData); */
      if ((jsonData.succes = true && !interval)) {
        $(".payment-submit-wrap").show();
        acdc_msi(token);
      }
      return true;
    } catch (error) {
      console.error("Error fetching data:", error);
      return false;
    }
  };

  let cardTest = await fetchData();
}

async function acdc_msi(token) {
  let ms_config_acdc = await msi_config_acdc();
  const fetchData = async () => {
    try {
      var myHeaders = new Headers();
      myHeaders.append("Content-Type", "application/json");

      var raw = JSON.stringify({
        clientProfileId: vtexjs?.checkout?.orderForm?.userProfileId,
        amount: vtexjs?.checkout?.orderForm?.value,
        country: "MEX",
        currency: "MXN",
        cardId: token,
      });

      var requestOptions = {
        method: "POST",
        headers: myHeaders,
        body: raw,
        redirect: "follow",
      };

      const response = await fetch(
        "/_v/paypalstore.payment-provider/v0/payments/acdc/financial-options",
        requestOptions
      );

      const jsonData = await response.json();
      return jsonData;
    } catch (error) {
      console.error("Error fetching data:", error);
      return false;
    }
  };

  $("#paypal-loading-acdc-cards").show();
  $("#acdc-table").hide();
  let cardTest = await fetchData();
  /* console.log(cardTest,ms_config_acdc) */
  msi_acdc_construct(cardTest, ms_config_acdc, token);
}

function msi_acdc_construct(ms_available, ms_config_acdc, token) {
  $("#msi-select-acdc").remove();
  $("#msi-text-acdc").remove();
  /* console.log(ms_available,ms_config_acdc) */
  if (
    ms_config_acdc.data.enablemsi != true &&
    ms_available.options.length >= 1
  ) {
    let PS = document.createElement("p");
    PS.className = "msi-text";
    PS.id = "msi-text-acdc";
    let SE = document.createElement("select");
    let DOP = document.createElement("option");
    PS.innerHTML = "Puedes diferir tu pago a meses";
    SE.id = "msi-select-acdc";
    DOP.value = 1;
    DOP.setAttribute("data-pm", ms_available.options[0].interval);
    DOP.innerHTML = "Pago de contado";
    SE.setAttribute("data-token", token);
    SE.setAttribute("data-default-term", ms_available.options[0].term);
    SE.setAttribute("onChange", 'select_card("' + token + '",this.value,$("option:selected",this).data("pm"))');
    SE.appendChild(DOP);
    const orderFormValue = vtexjs?.checkout?.orderForm?.value;
    ms_available.options.slice(1).forEach((option, index) => {
      if (true) {
        let OP = document.createElement("option");
        OP.value = option.term;
        OP.innerHTML = option.term + " Meses sin Intereses";
        OP.setAttribute("data-term", option.term);
        OP.setAttribute("data-pm",option.interval)
        SE.appendChild(OP);
        document.getElementById("selectACDC" + token).append(PS);
        document.getElementById("selectACDC" + token).append(SE);
      }
    });
  } else if (ms_config_acdc.data.enablemsi == true &&
    ms_available.options.length >= 1) {
    let PS = document.createElement("p");
    PS.className = "msi-text";
    PS.id = "msi-text-acdc";
    let SE = document.createElement("select");
    let DOP = document.createElement("option");
    PS.innerHTML = "Puedes diferir tu pago a meses";
    SE.id = "msi-select-acdc";
    DOP.value = 1;
    DOP.setAttribute("data-pm", ms_available.options[0].interval);
    DOP.innerHTML = "Pago de contado";
    SE.setAttribute("data-token", token);
    SE.setAttribute("data-default-term", ms_available.options[0].term);
    SE.setAttribute("onChange", 'select_card("' + token + '",this.value,$("option:selected",this).data("pm"))');
    SE.appendChild(DOP);
    const orderFormValue = vtexjs?.checkout?.orderForm?.value;
    ms_available.options.slice(1).forEach((option, index) => {
      const configMatch = ms_config_acdc.data.config.some((config) => {
        return option.term === config.term && orderFormValue > (config.amount*100);
      });
      if (configMatch) {
        let OP = document.createElement("option");
        OP.value = option.term;
        OP.innerHTML = option.term + " Meses sin Intereses";
        OP.setAttribute("data-term", option.term);
        OP.setAttribute("data-pm",option.interval)
        SE.appendChild(OP);
        document.getElementById("selectACDC" + token).append(PS);
        document.getElementById("selectACDC" + token).append(SE);
      }
    });
  }else{
    let PS = document.createElement("p");
    PS.className = "msi-text";
    PS.id = "msi-text-acdc";
    PS.innerHTML = "Meses sin intereses no disponibles";
    document.getElementById("selectACDC" + token).append(PS);
  }
  $("#paypal-loading-acdc-cards").hide();
  $("#acdc-table").show();
}

async function msi_config_acdc() {
  const fetchData = async () => {
    try {
      var myHeaders = new Headers();
      myHeaders.append("Content-Type", "application/json");

      var requestOptions = {
        method: "GET",
        headers: myHeaders,
        redirect: "follow",
      };

      const response = await fetch(
        "/_v/paypalstore.payment-provider/v0/payments/store-msi-config",
        requestOptions
      );

      const jsonData = await response.json();
      /* console.log(jsonData) */
      return jsonData;
    } catch (error) {
      console.error("Error fetching data:", error);
      return false;
    }
  };

  let msi_cards = await fetchData();
  return msi_cards;
}

