async function initPaypalACDC() {
  setTimeout(async function () {
    $(".box-payment-group2.box-payment-option.PayPalACDCPaymentGroup").empty();
    $(".box-payment-group2.box-payment-option.PayPalACDCPaymentGroup").empty();
    $(".box-payment-group2.box-payment-option.PayPalACDCPaymentGroup").append(
      PayPalACDCBody
    );
    $("#acdc-newcard-container").hide()
    $("head").append(stylefragACDC);
    client_ID_ACDC = vtexjs.checkout.orderForm.userProfileId;
    let needLogin = await checkCards();
    //$(".payment-submit-wrap").hide()
    /* console.log(needLogin) */
    isLogoOn = needLogin?.displayPoweredByPayPalLogo
    if(needLogin?.forceLogin == true){
      if (vtexjs.checkout.orderForm.loggedIn == true) {
        /* console.log("ACDC LogguedIn") */
        setTimeout(function () {
          if ($("#main-acdc").length) {
            buildFormACDC();
            $("#acdc-newcard-container").show()
            if(isLogoOn){
              $("#poweredby-logo").show()
            }
          } else {
            initPaypalACDC();
          }
        }, 1000);
      } else if (vtexjs.checkout.orderForm.loggedIn == false) {
        if ($("#main-acdc").length) {
          /* CÓDIGO DE NO LOGUEADO */
          /* console.log("ACDC Not LogguedIn") */
          $("#paypal-loading-acdc").hide();
          $("#acdc-newcard").hide();
          is_not_loggedin_ACDC();
          if ($("#payment-group-PayPalACDCPaymentGroup").hasClass("active")) {
            vtexid.start();
            setTimeout(function () {
              $("#PaypalInitACDC").show();
            }, 1000);
          }
          document
            .getElementById("payment-group-PayPalBCDCPaymentGroup")
            .addEventListener("click", function () {
              if (
                $("#payment-group-PayPalACDCPaymentGroup").hasClass("active") &&
                document.getElementById("main-acdc") &&
                vtexjs.checkout.orderForm.loggedIn == false
              ) {
                vtexid.start();
                setTimeout(function () {
                  $("#PaypalInitACDC").show();
                }, 1000);
              } else {
                $(".payment-submit-wrap").show();
              }
            });
        } else {
          initPaypalACDC();
        }
      } else {
        /* console.error("PayPal ACDC Service - VtexJS Error") */
      }
    }else{
      if(vtexjs.checkout.orderForm.loggedIn == false){
        if ($("#main-acdc").length) {
          /* CÓDIGO DE NO LOGUEADO */
          /* console.log("ACDC Not LogguedIn No Force") */
          $("#paypal-loading-acdc").hide();
          $("#acdc-newcard").hide();
          is_not_loggedin_ACDC();
          $("#PaypalNLPNACDC").show()
        } else {
          initPaypalACDC();
        }
      }else{
        setTimeout(function () {
          if ($("#main-acdc").length) {
            buildFormACDC();
            $("#acdc-newcard-container").show()
            if(isLogoOn){
              $("#poweredby-logo").show()
            }
          } else {
            initPaypalACDC();
          }
        }, 1000);
      }
    }
  }, 2000);
}

$(document).ready(function () {
  if (window.location.hash.indexOf("payment") != -1) {
    initPaypalACDC();
  }
  window.addEventListener("hashchange", function () {
    if (window.location.hash.indexOf("payment") != -1) {
      initPaypalACDC();
    }
  });
});

$(document).ready(function () {
  if (window.location.hash.indexOf("payment") != -1) {
    setTimeout(function () {
      $("#payment-group-PayPalACDCPaymentGroup span").text("");
      $("#payment-group-PayPalACDCPaymentGroup span").text(
        paypal_ACDC_paymentname
      );
    }, 800);
  }

  window.addEventListener("hashchange", function () {
    if (window.location.hash.indexOf("payment") != -1) {
      $("#payment-group-PayPalACDCPaymentGroup span").text("");
      $("#payment-group-PayPalACDCPaymentGroup span").text(
        paypal_ACDC_paymentname
      );
    }
  });
});

$(window).on("orderFormUpdated.vtex", function (evt, orderForm) {
  if (window.location.hash.indexOf("payment") != -1) {
    if (!$("#main-paypal").length) {
      initPaypalACDC();
    }
    $("#payment-group-PayPalACDCPaymentGroup span").text("");
    $("#payment-group-PayPalACDCPaymentGroup span").text(
      paypal_ACDC_paymentname
    );
  }
});
 